import { Post } from "../Post/Post";
import "./Blogs.css";
import { useState, useEffect } from "react";

export const Blogs = () => {
  const [data, setData] = useState([]);
  const getData = async () => {
    let result = await fetch("http://localhost:5002/api/posts/allposts");
  };

  useEffect(() => {
    getData;
  }, [data]);

  return (
    <div className="Blogs">
      {data.map((index) => {
        return (
          <Post
            key={index.id}
            title={index.title}
            img={index.image}
            description={index.Desc}
          />
        );
      })}
    </div>
  );
};
